import React, {Component}  from 'react';
import PropTypes from 'prop-types';


class Pokemon extends Component {
  render() {
    const name = this.props.objectPokemon.name;
    const type = this.props.objectPokemon.type;
    const value = this.props.objectPokemon.averageWeight.value;
    const unit = this.props.objectPokemon.averageWeight.measurementUnit;

    return <div className='Pokemon'>      
      <p>{name}</p>
       <p>{type}</p>
      <p>{value} {unit}</p>         
    </div>
  }
}
/*
Pokemon.prototype = {
  name: PropTypes.string,
  type: PropTypes.string,
  averageWeight: PropTypes.object,  
}
*/
export default Pokemon;
